type RecipeProps = {
  title: string;
  subtitle: string;
  description: string;
  amount: number;
  ingredient: string;
};

const Recipe = ( recipe: RecipeProps) => {
  return (
    <article>
      <h1>{title}</h1>
      <h2>{subtitle}</h2>
      <p>{description}</p>
      <div>
        <span>{amount}</span>
        <span>{ingredient}</span>
      </div>
    </article>
  );
};

export default Recipe;
